def html_to_pdf(
    html_file: str, pdf_file: str, css_file: Optional[str] = None
) -> None:
    # Create an HTML object with the content and CSS styles
    with open(html_file, "r") as htmlf:
        html_content = htmlf.read()
        css_content = CSS_DEFAULT
        if css_file:
            with open(css_file, "r") as css:
                css_content = css.read()
        html = HTML(string=html_content, base_url=os.getcwd())
        css = CSS(string=css_content, base_url=os.getcwd())
        html.write_pdf(pdf_file, stylesheets=[css])


def md_to_html(md_file: str, html_file: Optional[str]) -> None:
    # Convert Markdown to HTML with the table extension enabled
    with open(md_file, "r") as mdf:
        md_content = mdf.read()
        html_content = markdown2.markdown(md_content, extras=["tables"])
        if DEBUG:
            print(html_content)
        if html_file:
            with open(html_file, "w") as html:
                html.write(html_content)


def md_to_pdf(md_file: str, pdf_file: str, css_file: Optional[str] = None):
    html_file = md_file.replace(".md", ".html")
    md_to_html(md_file, html_file)
    html_to_pdf(html_file, pdf_file, css_file)
    os.remove(html_file)


def mdx_to_html(filename: str, html_file: Optional[str]) -> None:
    # Convert Spyderbat Markdown to HTML with the grid, chart and table extension enabled
    with open(filename) as mdxf:
        mdx = mdxf.read()
        html = markdown2.markdown(mdx, extras=["tables"])
        htmlx = bs4.BeautifulSoup(html, features="html5lib")
        charts = [
            tag
            for tag in htmlx.find_all("code")
            if tag.text.startswith("chart")
        ]
        for index, chart in enumerate(charts):
            chart_to_div(htmlx, chart, index)

        grids = [
            tag
            for tag in htmlx.find_all("code")
            if tag.text.startswith("grid")
        ]
        for index, grid in enumerate(grids):
            grid_to_div(htmlx, grid, index)

        lib_charts_tag = htmlx.new_tag(
            "script",
            type="text/javascript",
            src="https://cdn.jsdelivr.net/npm/chart.js",
        )
        lib_grids_tag = htmlx.new_tag(
            "script",
            type="text/javascript",
            src="https://tabulator.info/js/tabulator/6.2/tabulator.min.js",
        )

        script_tag = htmlx.new_tag("script", type="text/javascript")
        script_tag.string = make_js(charts, grids)
        body = htmlx.find("body")
        if body:
            body.append(lib_charts_tag)
            body.append(lib_grids_tag)
            body.append(script_tag)
        head = htmlx.find("head")
        if head:
            style = htmlx.new_tag("style", type="text/css")
            style.string = CSS_DEFAULT
            head.append(style)
            link = htmlx.new_tag(
                "link",
                href="https://tabulator.info/css/tabulator/6.2/tabulator.min.css",
                rel="stylesheet",
            )
            head.append(link)
        html_content = htmlx.prettify()
        if DEBUG:
            print(html_content)
        if html_file:
            with open(html_file, "w") as html:
                html.write(html_content)


def chart_to_div(htmlx, code_tag: bs4.Tag, index: int):
    div_tag = htmlx.new_tag("div", attrs={"class": "chart"})
    canvas_tag = htmlx.new_tag("canvas", id=f"chart_{index}")
    div_tag.append(canvas_tag)
    code_tag.replace_with(div_tag)


def grid_to_div(htmlx, code_tag: bs4.Tag, index: int):
    div_tag = htmlx.new_tag("div", attrs={"class": "grid"}, id=f"grid_{index}")
    code_tag.replace_with(div_tag)


def chart_definition(chart: bs4.Tag):
    chart_definition_str = chart.text.split("chart")[1].strip()
    chart_definition = json.loads(chart_definition_str)
    options = chart_definition.get("options", {})
    text_title = options.get("title")
    if text_title:
        options.setdefault("plugins", {})
        options["plugins"]["title"] = {"display": True, "text": text_title}
    options["elements"] = {"line": {"tension": 0.25}}
    chart_definition["options"] = options
    for ds in chart_definition["data"]["datasets"]:
        ds["pointStyle"] = False
    return chart_definition


def make_js(charts: list, grids: list):
    rv = "(async function() {\n"
    rv += "\n".join(
        [
            chart_def_to_chartjs(chart_definition(chart), index)
            for index, chart in enumerate(charts)
        ]
    )
    rv += "})();\n"
    rv += """
    var unitFormatter = function(cell, formatterParams, onRendered){
    precision = formatterParams.precision;
    factor = Math.pow(10, precision);
    unit = formatterParams.unit;
    multiplier = formatterParams.multiplier;
    var cellValue = cell.getValue();
    var scaledValue = cellValue*multiplier;
    return Math.round(scaledValue*factor)/factor + unit;
};

"""

    rv += "\n".join(
        [
            grid_def_to_tabulator(grid_definition(grid), index)
            for index, grid in enumerate(grids)
        ]
    )
    return rv


def grid_definition(grid: bs4.Tag):
    grid_definition_str = grid.text.split("grid")[1].strip()
    try:
        grid_definition = json.loads(grid_definition_str)
        options = grid_definition.get("options", {})
        grid_definition.update(options)
        del grid_definition["options"]
        return grid_definition
    except json.JSONDecodeError:
        return {
            "error": {"message": "Invalid grid definition"},
            "grid_definition": grid_definition_str,
        }


def grid_def_to_tabulator(grid_definition: dict, index: int):
    grid_def_str = json.dumps(grid_definition, indent=4)
    grid_def = grid_def_str.replace('"unitFormatter"', "unitFormatter")
    rv = "new Tabulator(\n"
    rv += f'    document.getElementById("grid_{index}"),\n'
    rv += f"    {grid_def}\n"
    rv += ");\n"
    return rv


def chart_def_to_chartjs(chart_definition: dict, index: int):
    rv = " new Chart(\n"
    rv += f'    document.getElementById("chart_{index}"),\n'
    rv += f"    {json.dumps(chart_definition, indent=4)}\n"
    rv += ");\n"
    return rv


if __name__ == "__main__":
    input_file = "sample.md"
